import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, Navbar, Container, Row, Col } from 'react-bootstrap';


function App() {
  return (

    <div className="App">

      <Navbar bg="mmColour" variant="dark" fixed="top" 
        collapseOnSelect>
        {/* <Container> */}
          <Navbar.Brand>
            MarketManager
          </Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse>
            <Nav>

              <Nav.Link href="#">Home</Nav.Link>
              <Nav.Link href="#">My Account</Nav.Link>
              <Nav.Link href="#">Help</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        {/* </Container> */}
      </Navbar>


      <div className="content">
        This is content.
      </div>
    </div>


  );
}

export default App;
